class Index extends React.Component{
	render(){
		return(
		<div>
		  	<h1>Welcome to Index Page</h1>
		  	<a href="/"> Home </a>
		  	<a href="/about"> About </a>
		  	<a href="/portfolio"> Portfolio </a>
		  	<a href="/blogs"> Blogs </a>
	  	</div>
	  	)
	}
}
export default Index;
